<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
</head>
<body>
<script>
    let A=[7,2,5,3,5,3];
    let B=[7,2,5,4,6,3,5,3];
    for(let i=0;i<A.length;i++){
        for(let j=0;j<B.length;j++){
            if(A[i]==B[j]){
                B.splice(j,1);
            }
        }
    }
    document.write(B.join());
</script>
</body>
</html>
